<script>
    function exibeCabecalho() {
        if ($('#tbody-list tr').length > 0) {
            $('#table').show()
            $('#message').hide()
        }
        else {
            $('#table').hide()
            $('#message').show()
        }
    }

    $('#nome').on('change', function () {
        $('#tbody-list').html('')
        $.ajax({
            url: '/home/consultar',
            type: 'get',
            data: {
                nome: $('#nome').val()
            },
            success: function (response) {
                if (response != null) {
